import React from 'react';
import Head from 'next/head';

import styled from 'styled-components';

import '../css/normalize.css';
import '../css/skeleton.css';
import '../css/mobile.css';
import '../css/scroller.css';

class SignUp extends React.Component{
	render(){

		return(
			<form>
				<div id='signUp'>

				<h3 id='signUpHeading'>CREATE ACCOUNT</h3>				

				<label for='first_name' id='firstnameSignUpText' /><span id='requireda'>*</span>
				<input type='text' name='first_name' id='firstnameSignup' />
				<label for='last_name' id='lastnameSignUpText' /><span id='required1'>*</span>
				<input type='text' name='last_name' id='lastnameSignup' />
				<label for='email' id='emailSignUpText' /><span id='required2'>*</span>
				<input type='text' name='email_field' id='emailSingup' />
				<label for='username' id ='usernameSignUpText' /><span id='required3'>*</span>
				<input type='text' name='username' id='usernameSignup' />
				<label for='dob' id ='birthdaySignUpText' /><span id='required6'>*</span>
				<input type='text' name='month' id='monthSignup' minlength='2' maxlength='2'  autocomplete='off' />
				<input type='text' name='day' id='daySignup' minlength='2' maxlength='2'  autocomplete='off' />
				<input type='text' name='year' id='yearSignup' minlength='4' maxlength='4'  autocomplete='off' /><span id='required7'>*</span>
				<label for='gender' id='genderSignUpText' />
				<label id='femaleCheck' class='signupOption'>
				<input type='checkbox' for='gender' id='female' name='sex' className='signupCheckBox' value='female'  /><span id='checkboxText'>FEMALE</span>
				</label>
				<label id='maleCheck' class='signupOption'>
				<input type='check_box' for='gender' id='male' name='sex' className='signupCheckBox' value='male'  /><span id='checkboxText'>MALE</span>
				</label>
				<input name='gender' id='gender' hidden />

				<label id='locationSignUpText'>Location</label>


				<button id='signupButton'>REGISTER</button>


				</div> 
			</form>
		)
	}
}

export default SignUp;
